import image from '../assets/multiplePizzas.jpeg'

function About() {
  return (
    <div className='about'>
        <div className="aboutTop" style={{backgroundImage: `url(${image})`}}>dddddd</div>
        <div className="aboutBottom"></div>
    </div>
  )
}

export default About
